    let timing = rhdl_toolchains::icestorm::IceStorm::new("hx8k", "cb132", "build").time(uut)?;
    eprintln!("Timing: {timing:?}");
    eprintln!(
        "Total delay: {} nsec",
        timing.logic_delay + timing.routing_delay
    );
    Ok(())
}
